// import { Link, Switch, Route } from "react-router-dom";
import About from "./About";
import Contact from "./Contact";

import Footer from "./Footer";
import Header from "./Header";
import NotFound from "./NotFound";

import { useEffect, useState } from "react";
import { useNavigate, Routes, Route, Link } from "react-router-dom";
import Signup from "./Signup";
import Profile from "./Profile";
import Login from "./Login";
import Admin from "./Admin.js";

import Add from "./Add";
import Edit from "./Edit";
import EmpList from "./EmpList";
import AddEmp from "./AddEmp";
import EditEmp from "./EditEmp";
import DeliveryBoy from "./DeliveryBoy";
import Auth from "./NavigateToFromLogin";
import { ToastContainer } from 'react-toastify'
import 'react-toastify/dist/ReactToastify.css'

function Launch() {
  const [username, setUserName] = useState("User");

  const { SignIn, SignOut } = Auth();

  useEffect(() => {
    if (sessionStorage.getItem("username") != null) {
      setUserName(sessionStorage.getItem("username"));
    } else {
      setUserName("User");
    }
  }, []);

  const ShowButton = () => {
    if (username == "User") {
      return (
        <button className="btn btn-warning" onClick={SignIn}>
          Log In
        </button>
      );
    } else {
      return (
        <button
          className="btn btn-warning"
          onClick={() => {
            SignOut(setUserName);
          }}
        >
          Log out
        </button>
      );
    }
  };
  return (
    <>
      <Header></Header>

      <div className="nav">
        <div style={{ paddingLeft: 50 }}>
          Welcome {username}
          {ShowButton()}
        </div>

        {"   |   "}
        <Link to="/about">About Us</Link>
        {"   |   "}
        <Link to="/contact">Contact Us</Link>
        {"   |   "}
        <Link to="/signup">Signup</Link>
        {"   |   "}
        <Link to="/profile">Profile</Link>
      </div>
      {/* <Switch>

        <Route path="/about" exact component={About} />
        <Route path="/contact" exact component={Contact} />
        <Route path="/signup" exact component={Signup} />
        <Route path="/admin" exact component={Admin} />


        <Route path="/add" exact component={Add} />
        <Route path="/Edit" exact component={Edit} />
        <Route path="/EmpList" exact component={EmpList} />
        <Route path="/addEmp" exact component={AddEmp} />
        <Route path="/EditEmp" exact component={EditEmp} />
        <Route path="/deliveryboy" exact component={DeliveryBoy} />


        <Route path="/" component={Login} />

        <Route path="*" component={NotFound} />
      </Switch> */}

      <Routes>
        {/* home component  */}
        {/* <Route path='/' element={} /> */}

        {/* login component */}


        {/* register component */}
        <Route path="/about" element={<About />} />

        {/* product-gallery component */}
        <Route path="/contact" element={<Contact />} />

        {/* cart component */}
        <Route path="/signup" element={<Signup />} />

        {/* my orders component */}
        <Route path="/profile" element={<Profile />} />
        <Route path="/Admin" element={<Profile />} />
        <Route path="/add"  element={<Add/> }/>
        <Route path="/Edit" element={<Edit/> }/>
        <Route path="/EmpList" element={<EmpList/>} />
        <Route path="/addEmp" element={<AddEmp/>} />
        <Route path="/EditEmp" element={<EditEmp/>} />
        <Route path="/deliveryboy" element={<DeliveryBoy/>} />
        <Route path="/" element={<Login />} />
      </Routes>
      <ToastContainer />

      <Footer></Footer>
    </>
  );
}

export default Launch;
